import React from "react";

export default function About() {
    return(
        <section id="about" className="text-white bg-black body-font">
            <div>
                <div class="text-9xl flex justify-center">
                    Alex
                </div>
                <div class="text-9xl ml-10">
                    Fox
                </div>
            </div>
        </section>
    );
}
